import { iTransaction } from "../../../../contexts/TransactionsContext";
import "./style.css";

export const Card = ({ description, value, type, id }: iTransaction) => {
  return (
    <li className={type == "Saída" ? "card card-output" : "card"}>
      <div className="description-type">
        <h2>{description}</h2>
        <span>{type}</span>
      </div>
      <div className="value-btn">
        <span>{value}</span>
        <button className="button-default" id={id}></button>
      </div>
    </li>
  );
};
